const input =
  "";

const test = "dabAcCaCBAcCcaDA";
const alphabet = "abcdefghijklmnopqrstuvwxyz";

const react = array =>
  array.reduce((acc, b) => {
    const last = acc[acc.length - 1];
    if (acc.length === 0) {
      return [b];
    }
    if (last !== b && last.toUpperCase() === b.toUpperCase()) {
      return acc.slice(0, -1);
    }
    return [...acc, b];
  }, []);

const removeUnit = (array, unit) =>
  array.filter(elem => elem.toUpperCase() !== unit.toUpperCase());
const removeAndReact = (array, unit) => react(removeUnit(array, unit));

const partOne = input => react(input.split(""));

const partTwo = input => {
  const arr = input.split("");

  return alphabet.split("").reduce((minReact, b) => {
    const currentReact = removeAndReact(arr, b);
    if (currentReact.length < minReact.length || minReact.length === 0) {
      return currentReact;
    }
    return minReact;
  }, []);
};

const partOneTest = partOne(test);
const partOneFull = partOne(input);

const partTwoTest = partTwo(test);
const partTwoFull = partTwo(input);

console.log("PartOne test:", partOneTest.length);
console.log("PartOne full:", partOneFull.length);
console.log("PartTwo test:", partTwoTest.length);
console.log("PartOne full:", partTwoFull.length);
